import React from 'react';
import ExpandableQuestion from '../ExpandableQuestion';

const Moments = () =>
{
    return (
        <div className="wrapper ui stretched container">
            <div className="ui center aligned huge header title">Moments</div>
        <div className="ui container comments">
            <ExpandableQuestion author={"Nick"} avatar={"./chapters/Moments"} text={"Some text"} date={"Today"}/>
        </div> 
        </div>       
    );
};

export default Moments;
